import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Switch to List View Mode
    await page.waitForSelector('.view-btn'); // Wait for view buttons to be available
    await page.click('.view-btn.active + .view-btn'); // Click on the List View button

    // Take screenshot after switching to List View
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_list_view.png'));

    // Verify if the List View is active
    const isListViewActive = await page.evaluate(() => {
      return document.querySelector('.view-btn.active').textContent.includes('List');
    });

    return {
      success: true,
      action: "Switched to List View Mode",
      extractedData: { isListViewActive },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
